import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <header class="main-container">
      <div class="container">
        <div class="row">
          <div class="col">
            <span class="logo">
              <div class="heading">Plant trees for free</div>
              <div class="sub-heading">Make the planet better</div>
            </span>
          </div>
          <div class="col">
            <span class="login">
              <div class="title">Sign in</div>
              <div class="input-wrapper">
                <input
                  type="text"
                  id="username"
                  class="input-field"
                  aria-label="Username"
                  placeholder="Username"
                />
                <input
                  type="password"
                  id="password"
                  class="input-field"
                  aria-label="Password"
                  placeholder="Password"
                />
              </div>
              <button class="login-button" aria-label="Login">Login</button>
              <div class="register-text">
                <div class="content-text">Otherwise, please</div>
                <div class="link-text">Register here</div>
              </div>
            </span>
          </div>
        </div>
      </div>
    </header>
  `,
  styles: [
    `
      .main-container {
        justify-content: center;
        align-self: stretch;
        background-color: var(--whitePure, #081c15);
        display: flex;
        max-width: 955px;
        flex-direction: column;
        padding: 50px 16px;
      }
      .container {
        margin: 128px 0 67px;
      }
      @media (max-width: 991px) {
        .container {
          max-width: 100%;
          margin: 40px 0;
        }
      }
      .row {
        gap: 20px;
        display: flex;
      }
      @media (max-width: 991px) {
        .row {
          flex-direction: column;
          align-items: stretch;
          gap: 0px;
        }
      }
      .col {
        display: flex;
        flex-direction: column;
        line-height: normal;
        width: 55%;
        margin-left: 0px;
      }
      @media (max-width: 991px) {
        .col {
          width: 100%;
        }
      }
      .logo {
        align-self: stretch;
        display: flex;
        flex-direction: column;
        margin: auto 0;
      }
      @media (max-width: 991px) {
        .logo {
          max-width: 100%;
          margin-top: 40px;
        }
      }
      .heading {
        color: var(--greenDark, #e8f5f1);
        font: 500 24px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .heading {
          max-width: 100%;
        }
      }
      .sub-heading {
        color: var(--greenDark, #e8f5f1);
        margin-top: 8px;
        font: 500 24px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .sub-heading {
          max-width: 100%;
        }
      }
      .col {
        display: flex;
        flex-direction: column;
        line-height: normal;
        width: 45%;
        margin-left: 20px;
      }
      @media (max-width: 991px) {
        .col {
          width: 100%;
        }
      }
      .login {
        justify-content: center;
        display: flex;
        flex-grow: 1;
        flex-direction: column;
      }
      @media (max-width: 991px) {
        .login {
          margin-top: 32px;
        }
      }
      .title {
        color: var(--greenDark, #e8f5f1);
        font-feature-settings: "clig" off, "liga" off;
        white-space: nowrap;
        font: 400 32px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .title {
          white-space: initial;
        }
      }
      .input-wrapper {
        color: var(--greenDark, #e8f5f1);
        margin-top: 32px;
        font: 500 14px Roboto, sans-serif;
      }
      .input-field {
        border-radius: var(--8, 8px);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        margin-top: 16px;
        flex-direction: column;
        justify-content: center;
      }
      .input-field {
        justify-content: center;
        align-items: center;
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }
      .input-field {
        color: var(--greenDark, #e8f5f1);
        margin-top: 16px;
        font: 500 14px Roboto, sans-serif;
      }
      .login-button {
        border-radius: var(--8, 8px);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        margin-top: 16px;
        flex-direction: column;
        justify-content: center;
      }
      .input-field {
        justify-content: center;
        align-items: center;
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }
      .login-button {
        color: var(--greenDark, #e8f5f1);
        margin-top: 16px;
        font: 500 14px Roboto, sans-serif;
      }
      .register-text {
        color: var(--cardsWhite, #081c15);
        white-space: nowrap;
        justify-content: center;
        align-items: center;
        border-radius: 6px;
        box-shadow: 0px 4px 61px 0px rgba(45, 106, 79, 0.4);
        background-color: var(--cardsMainColor, #f4fbf9);
        margin-top: 32px;
        padding: 11px 60px;
        font: 600 18px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .register-text {
          white-space: initial;
          padding: 0 20px;
        }
      }
      .link-text {
        align-items: center;
        display: flex;
        margin-top: 32px;
        justify-content: space-between;
        gap: 6px;
      }
      .content-text {
        color: var(--greenDark, #e8f5f1);
        margin: auto 0;
        font: 400 14px Poppins, sans-serif;
      }
      .link-text {
        color: var(--greenDark, #e8f5f1);
        font: 600 16px Poppins, sans-serif;
      }
    `,
  ],
})
export class MyComponent {}
